import Container from 'react-bootstrap/Container';

const ListUsers = () => {


    return (
        <>
            <Container>
                <span>
                    <b>List user: </b>
                </span>
                <button>Add new user</button>
            </Container>
        </>
    )
}

export default ListUsers
